var style = StyleSheet.create({
    container: {
        flex: 1,
        marginTop: 10,
      },
    activelist:{
        height:'20%',
        flexDirection:'row',
        borderBottomWidth:1,
        alignItems: 'center', justifyContent: 'center'
    },
    imageactive:{
        flex:1,
    },
    time:{
        flex:1,
        fontSize:30
    },
    active:{
        flex:2,
        alignItems: 'center', justifyContent: 'center'
    },
    activename:{
        flex:1,
        fontSize:20
    },
    activeDate:{
        flex:1
    }
});
